43X)"]},{"cell_type":"markdown","id":"a7ffeba4","metadata":{"papermill":{"duration":0.009559,"end_time":"2024-03-14T07:02:09.982281","exception":false,"start_time":"2024-03-14T07:02:09.972722","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"1e79e683","metadata":{"papermill":{"duration":0.010669,"end_time":"2024-03-14T07:02:10.003787","exception":false,"start_time":"2024-03-14T07:02:09.993118","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"712193d6","metadata":{"execution":{"iopub.execute_input":"2024-03-14T07:02:10.032521Z","iopub.status.busy":"2024-03-14T07:02:10.030247Z","iopub.status.idle":"2024-03-14T07:02:10.11507Z","shell.execute_reply":"2024-03-14T07:02:10.113013Z"},"papermill":{"duration":0.102325,"end_time":"2024-03-14T07:02:10.117937","exception":false,"start_time":"2024-03-14T07:02:10.015612","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>a